INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DWSN', 'STOCK', 'Dawson Geophysical Company', 'NMS', 'Energy', 'Oil & Gas Equipment & Services', 'Dawson Geophysical Company is a provider of North American onshore seismic data acquisition services with operations throughout the continental United States and Canada. The Company acquires and processes two-dimensional (2-D), three-dimensional (3-D) and multi-component seismic data solely for its clients, ranging from major oil and gas companies to independent oil and gas operators, as well as providers of multi-client data libraries. Its seismic data acquisition crews supply seismic data primarily to companies engaged in the exploration and development of oil and natural gas on land and in land-to-water transition areas. In addition to conventional 2-D and 3-D seismic surveys, it provides multi-component seismic data surveys. Multi-component surveys involve the recording of alternative seismic waves known as shear waves. It markets and supplements its services in the continental United States, Texas, and in Canada from its facilities in Calgary and Wheatland County, Alberta.', 'Midland, TX, United States', 233);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBNC', 'STOCK', 'First Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'First Bancorp is a bank holding company. The principal activity of the Company is the ownership and operation of the First Bank (the Bank), a state-chartered bank with its main office in Southern Pines, North Carolina. The Bank has two wholly owned subsidiaries, Magnolia Financial, Inc. (Magnolia Financial) and First Troy SPE, LLC. Magnolia Financial is a business financing company that makes loans throughout the southeastern United States. The Bank maintains a diversified loan portfolio by providing a broad range of commercial and retail lending services to business entities and individuals. The Bank provides commercial business loans, commercial and residential real estate construction and mortgage loans, revolving lines of credit, letters of credit, and loans for personal uses, home improvement, and automobiles. The Bank offers a full range of deposit accounts and services to both retail and commercial customers. The Bank operates about 113 branches.', 'Southern Pines, NC, United States', 1345);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSTZ', 'STOCK', 'BlackRock Science and Technology Term Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Science and Technology Term Trust is a closed-ended equity mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating in the science and technology sectors. It primarily invests in growth stocks of companies across all market capitalizations. BlackRock Science and Technology Term Trust was formed in June 2019 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('KROS', 'STOCK', 'Keros Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Keros Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing and commercializing novel therapeutics to treat a range of patients with disorders that are linked to dysfunctional signaling of the transforming growth factor-beta (TGF-B), family of proteins. Its lead product candidate, KER-050, is being developed for the treatment of low blood cell counts, or cytopenias, including anemia and thrombocytopenia, in patients with myelodysplastic syndromes, and in patients with myelofibrosis. Its product candidate, KER-012, is being developed for the treatment of pulmonary arterial hypertension, or PAH, and for the treatment of cardiovascular disorders. Its product candidate, KER-065, is being developed for the treatment of obesity and for the treatment of neuromuscular diseases. KER-050 is designed to raise red blood cell and platelet production by inhibiting the signaling of a subset of the TGF-B family of proteins to promote hematopoiesis.', 'Lexington, MA, United States', 148);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIZ', 'STOCK', 'Assurant, Inc.', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'A Assurant, Inc. É uma empresa de proteção global que faz parceria com várias marcas para proteger e prestar serviços de dispositivos conetados, residências e automóveis. Ele utiliza soluções tecnológicas orientadas por dados para fornecer experiências aos clientes. Atua na América do Norte, América Latina, Europa e Ásia-Pacífico por meio de dois segmentos operacionais: Global Lifestyle e Global Housing. A Global Lifestyle Segment fornece soluções de dispositivos móveis, contratos de serviços estendidos e serviços relacionados para eletrônicos e eletrodomésticos de consumo e outros produtos de seguros (referidos como Vida Conectada), e serviços de proteção de veículos, serviços de equipamentos comerciais e outros serviços relacionados (referidos como Global Automotive). O segmento de habitação global fornece proprietários de imóveis, habitação manufaturada e seguro de inundação, bem como habitação manufaturada voluntária, seguro de condomínio e proprietários (referidos como proprietári', 'Atlanta, GA, United States', 14200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBDO', 'STOCK', 'Banco Bradesco S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'O Banco Bradesco SA, anteriormente Banco Brasileiro de Descontos SA, é uma empresa pública brasileira que atua no Grupo Setor de Serviços Bancários. A Companhia atua como um amplo banco comercial em termos de ativos totais, operações de crédito e volume de depósitos e financiamentos. A Companhia oferece uma gama de produtos e serviços bancários e financeiros, no Brasil e no exterior, para indivíduos e principais empresas e instituições nacionais e internacionais. Os produtos e serviços da Companhia abrangem operações bancárias e não bancárias, tais como: Empréstimos e adiantamentos, depósitos, emissão de cartões de crédito, consórcio, seguros, etc. capitalização, leasing, cobrança e processamento de pagamentos, planos de pensões complementares, gestão de ativos e serviços de intermediação e corretagem de valores mobiliários.', 'Osasco, SP, Brazil', 82147);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAP', 'STOCK', 'Credicorp Ltd.', 'NYQ', 'Financial Services', 'Banks - Regional', 'A Credicorp Ltd é uma holding de serviços financeiros sediada no Peru. A Companhia está organizada em quatro linhas de negócios: Universal Banking, Seguros e Previdência que atendem principalmente o mercado peruano em geral, Microfinanças e Investment Banking e Gestão de Patrimonio que têm forte presença na América Latina. A Companhia alavancou suas franquias e se consolidou em um Grupo com mais de 36.000 funcionários e operações principalmente em seis países: Peru, Bolívia, Colômbia, Chile, Panamá e Estados Unidos.', 'Lima, , Peru', 46621);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASG', 'STOCK', 'Liberty All-Star Growth Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Liberty All-Star Growth Fund, Inc. is a closed-ended equity mutual fund launched and managed by ALPS Advisers, Inc. It is co-managed by Weatherbie Capital, LLC, Congress Asset Management Company, and Sustainable Growth Advisers, LP. The fund invests in the public equity markets of the United States. It seeks to invest in stocks of companies operating across diversified sectors. The fund primarily invests in growth stocks of companies across all market capitalizations. It employs fundamental analysis with a bottom-up stock picking approach to create its portfolio. The fund benchmarks the performance of its portfolio against the NASDAQ Composite Index, Russell 3000 Growth Index, and the S&P 500 Index. It conducts in-house research to make its investments. The fund was previously known as Charles Allmon Trust, Inc. Liberty All-Star Growth Fund, Inc. was formed on March 14, 1986 and is domiciled in the United States.', 'Denver, CO, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMBC', 'STOCK', 'Embecta Corp.', 'NMS', 'Healthcare', 'Medical Instruments & Supplies', 'Embecta Corp. is a global medical device company focused on providing solutions to improve the health and well-being of people living with diabetes. The Company has a portfolio of marketed products, including a variety of pen needles, syringes and safety injection devices. Its pen needles are sterile, single-use, medical devices, designed to be used in conjunction with pen injectors that inject insulin or other diabetes medications. It also sells safety pen needles, which have shields on both ends of the cannula that automatically deploy after the injection to help prevent needlestick exposure and injury during injection and disposal. Its traditional and safety pen needles are compatible and frequently used with pen injectors in the market. It sells sterile, single-use insulin syringes, which are used to inject insulin drawn from insulin vials. It also sells safety insulin syringes. It distributes its products through a variety of channels, including retail, hospitals and pharmacies.', 'Parsippany, NJ, United States', 2100);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHK', 'STOCK', 'BlackRock Core Bond Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Core Bond Trust is a closed-ended fixed income mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in the fixed income markets of the United States. The fund primarily invests in investment grade quality bonds, including corporate bonds, government and agency securities, and mortgage-related securities. BlackRock Core Bond Trust was formed on November 30, 2001 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BENF', 'STOCK', 'Beneficient', 'NCM', 'Financial Services', 'Asset Management', 'Beneficient is a technology-enabled financial services holding company that provides liquidity, primary capital solutions and related trust and custody services to holders of alternative assets through its proprietary online platform, AltAccess. The AltAccess platform provides end-to-end liquidity, custody, and investment analytics solutions through AltQuote, AltLiquidity, AltCustody, AltData, and AltTrading. The Company''s segments include Ben Liquidity, Ben Custody, and Customer ExAlt Trusts. The Ben Liquidity segment is responsible for offering its fiduciary alternative asset liquidity and financing products through AltAccess. The Ben Custody segment delivers products that address the administrative and regulatory burden of holding alternative assets by offering full service bespoke custody and trust administration services, and specialized document custodian services to customers. The Customer ExAlt Trusts segment holds interests in alternative assets.', 'Dallas, TX, United States', 80);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABM', 'STOCK', 'ABM Industries Incorporated', 'NYQ', 'Industrials', 'Specialty Business Services', 'ABM Industries Inc, which operates through its subsidiaries, is a provider of integrated facility, infrastructure, and mobility solutions. The Companys segments include Business & Industry (B&I), Manufacturing & Distribution (M&D), Education, Aviation, and Technical Solutions. The B&I segment encompasses janitorial, facilities engineering, and parking services for commercial real estate properties, sports and entertainment venues, and other facilities. The M&D segment provides integrated facility services, engineering, janitorial, and other specialized services. The Education segment delivers janitorial, custodial, landscaping and grounds, facilities engineering, and parking services. The Aviation segment supports airlines and airports with services ranging from parking and janitorial to passenger assistance, catering logistics, air cabin maintenance, and transportation. The Technical Solutions segment specializes in facility infrastructure, mechanical and electrical services.', 'New York, NY, United States', 117000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCAP', 'STOCK', 'Crescent Capital BDC, Inc.', 'NGM', 'Financial Services', 'Asset Management', 'Crescent Capital BDC, Inc. is a specialty finance company focused on lending to middle-market companies. The Companys investment objective is to maximize the total return to its stockholders in the form of current income and capital appreciation through debt and related equity investments. It invests primarily in secured debt, including first lien, unitranche first lien and second-lien debt, and unsecured debt, including mezzanine and subordinated debt, as well as related equity securities of private United States middle-market companies. It is focused on purchasing interests in loans or making debt investments, either directly from its target companies as primary market or private credit investments (private credit transactions), or primary or secondary market bank loans or high-yield transactions in the syndicated market (syndicated loans and bonds). Although its focus is on investing in less liquid private credit transactions. The Company is managed by Crescent Cap Advisors, LLC.', 'Los Angeles, CA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASIX', 'STOCK', 'AdvanSix Inc.', 'NYQ', 'Basic Materials', 'Chemicals', 'AdvanSix Inc. is a diversified chemistry company that produces essential materials for its customers in a variety of end markets and applications, including building and construction, fertilizers, agrochemicals, plastics, solvents, packaging, paints, coatings, adhesives and electronics. Its product lines include nylon solutions, plant nutrients, and chemical intermediates. It sells its Nylon 6 resin globally, under the Aegis brand name. It markets and sells ammonium sulfate to North American and South American distributors, farm cooperatives and retailers to fertilize crops. It also manufactures sulfuric acid, ammonia and carbon dioxide. It manufactures, markets and sells a number of chemical intermediate products. Its other intermediate chemicals include phenol, alpha-methyl styrene (AMS), cyclohexanone, oximes, cyclohexanol, and alkyl and specialty amines. Additional end-products for intermediates include automotive components, and water treatment and pharmaceutical intermediates.', 'Parsippany, NJ, United States', 1450);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRI', 'STOCK', 'Air Industries Group', 'ASE', 'Industrials', 'Aerospace & Defense', 'Air Industries Group is a manufacturer of precision components and assemblies for large aerospace and defense prime contractors. Its products include landing gears, flight controls, engine mounts and components for aircraft jet engines, ground turbines and other complex machines. Its end user for most of its products is the U.S. Government, international governments, and commercial global airlines. Whether it is a small individual component or complete assembly, its products are used in mission-critical operations that are essential for the safety of military personnel and civilians. Its platforms and programs include the E-2D Hawkeye, UH-60 Black Hawk Helicopter, Pratt & Whitney Geared Turbo-Fan Engine (GTF), the CH-53 Helicopter (including the CH53K variant), the F-35 Lightning II (also known as the Joint Strike Fighter), F-18 Hornet, and the F-15 Eagle Tactical Fighter. Its subsidiaries include Air Industries Machining, Nassau Tool Works, and Sterling Engineering Company.', 'Bay Shore, NY, United States', 184);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABVC', 'STOCK', 'ABVC BioPharma, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'ABVC BioPharma, Inc. is a clinical-stage biopharmaceutical company focused on developing products and technologies to combat various diseases. Its pipeline includes ABV-1504, ABV-1505, ABV-1601, ABV-1702, ABV-1703, ABV- 1501, ABV-1519 and ABV-1701. The Company is developing and researching ABV-1504, a botanical reuptake inhibitor that targets norepinephrine to treat Major Depressive Disorder (MDD). ABV-1505 to treat attention deficit hyperactivity disorder (ADHD). It has developed ABV-1601 for treating depression in cancer patients. ABV-1702 to treat Myelodysplastic syndromes. It has developed an indication for pancreatic cancer from maitake extract, named ABV-1703. ABV-1501 for the treatment of Triple Negative Breast Cancer. ABV-1701 Vitargus for the treatment of Retinal Detachment or Vitreous Hemorrhage. ABV-1519 for the treatment of Non-Small Cell Lung Cancer. It also focuses on the development of new drugs and medical devices derived from plants.', 'Fremont, CA, United States', 16);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFC', 'STOCK', 'Bank First Corporation', 'NCM', 'Financial Services', 'Banks - Regional', 'Bank First Corporation serves as the holding company of Bank First, N.A. (the Bank). The Bank has about 26 offices, including its headquarters, in Brown, Columbia, Dane, Fond du Lac, Jefferson, Manitowoc, Monroe, Outagamie, Ozaukee, Shawano, Sheboygan, Waupaca, Waushara, and Winnebago counties in the State of Wisconsin. The Bank serves businesses, professionals and consumers with a variety of financial services, including retail and commercial banking. The Bank offers products, including checking accounts, savings accounts, money market accounts, cash management accounts, certificates of deposit, commercial and industrial loans, commercial real estate loans, construction and development loans, residential mortgages, consumer loans, credit cards, online banking, telephone banking and mobile banking. The Bank has three subsidiaries: Bank First Investments, Inc., TVG Holdings, Inc., and BFC Title, LLC. Bank First Investments, Inc. provides investment and safekeeping services to the Bank.', 'Manitowoc, WI, United States', 368);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDTX', 'STOCK', 'Cidara Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cidara Therapeutics, Inc. is a biotechnology company. The Company is using its Cloudbreak platform to develop drug-Fc conjugate (DFC), immunotherapies designed to save lives and improve the standard of care for patients facing serious diseases. The Companys Cloudbreak platform enables development of DFCs that inhibit specific disease targets while simultaneously engaging the immune system. The Companys lead DFC candidate CD388, is a highly potent antiviral designed to deliver universal prevention and treatment of seasonal and pandemic influenza, which has completed Phase I and Phase IIa clinical trials. Its oncology DFC candidate, CBO421, is a development candidate targeting CD73 for the treatment of solid tumors. Its Cloudbreak platform creates single molecule cocktails by coupling targeted small molecules and peptides to a human antibody fragment (Fc). The Company is also advancing multiple preclinical and discovery programs targeting cancer and autoimmune diseases.', 'San Diego, CA, United States', 38);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFRG', 'STOCK', 'Bullfrog AI Holdings, Inc.', 'NCM', 'Healthcare', 'Health Information Services', 'Bullfrog AI Holdings, Inc. is a technology-enabled drug development company. The Company is focused specifically on advanced artificial intelligence/machine learning (AI/ML) analysis of complex data in the advancement of medicine. The Companys platform technology, bfLEAP, is an analytical AI/ML platform that is a potentially disruptive tool for the analysis of pre-clinical and/or clinical data sets, such as the robust pre-clinical and clinical trial data sets being generated in translational research and development and clinical trial settings. The platform can capture the genetic and physical characteristics of patients in an unbiased manner and contextualize them against other disparate data sources from patients. Its siRNA targets Beta2-spectrin in the treatment of human diseases, such as hepatocellular carcinoma, obesity, non-alcoholic fatty liver disease, and non-alcoholic steatohepatitis. Mebendazole is focused on targeting Glioblastoma.', 'Gaithersburg, MD, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADAG', 'STOCK', 'Adagene Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Adagene Inc is a platform-driven, clinical-stage biopharmaceutical company committed to transforming the discovery and development of novel antibody-based cancer immunotherapies. The Company is principally engaged in the research, development and production of monoclonal antibody drugs for cancers. The Companys main products include: ADG106 is being developed for the treatment of advanced solid tumors and non-Hodgkin''s lymphoma, or NHL. ADG126 is designed to address the toxicity and efficacy issues related to the MOA of existing approved CTLA-4 immuno-oncology therapies and to expand the potential of CTLA-4 as a target for the treatment of cancer. ADG116 is designed to target a unique conserved epitope of CTLA-4. And ADG104, a monospecific antibody that targets PD-L1 and is in Phase Ib and Phase II clinical trials concurrently in China.', 'Suzhou, , China', 138);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXT', 'STOCK', 'Crane NXT, Co.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Crane NXT, Co. is an industrial technology company that provides technology solutions to secure, detect, and authenticate what matters most to its customers. The Companys segments include Crane Payment Innovations (CPI), and Security and Authentication Technologies (SAT). The CPI segment provides electronic equipment and associated software leveraging extensive and proprietary core capabilities with various detection and sensing technologies for applications including verification and authentication of payment transactions. The CPI segment also provides advanced automation solutions, and processing systems, field service solutions, and remote diagnostics and productivity software solutions. The SAT segment provides advanced security solutions based on proprietary technology for securing physical products, including banknotes, consumer goods, and industrial products. The SAT segment also provides brand protection, authentication solutions, and digital content protection.', 'Waltham, MA, United States', 4500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANEB', 'STOCK', 'Anebulo Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Anebulo Pharmaceuticals, Inc. is a clinical-stage biotechnology company. It is engaged in developing treatments for cannabis toxicity, such as unintentional cannabis poisoning, acute cannabinoid intoxication (ACI) and the landscape of acute cannabis-induced conditions. Its lead product candidate is selonabant, a potent, small molecule antagonist of cannabinoid binding receptor type-1 (CB1), the primary receptor involved in the psychotropic effects of cannabinoids, with the potential to address the unmet medical need for a therapy to treat cannabis toxicity. Selonabant is orally bioavailable, rapidly absorbed, and has also been formulated for intravenous administration. Selonabant is intended to rapidly reverse the negative effects of cannabis-induced toxicity and reduce time to recovery. It is also prioritizing the advancement of a selonabant intravenous (IV) formulation as a potential treatment for pediatric patients with cannabis-induced CNS depression.', 'Lakeway, TX, United States', 2);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSJQ', 'STOCK', 'Invesco BulletShares 2026 High Yield Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated high yield corporate bonds (commonly known as "junk bonds") with maturities or, in some cases, "effective maturities" in the year 2026 (collectively, "2026 Bonds").', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTO', 'STOCK', 'Alto Ingredients, Inc.', 'NCM', 'Basic Materials', 'Specialty Chemicals', 'ALTO Ingredients, Inc. is a producer and distributor of specialty alcohols, renewable fuels and essential ingredients in the United States. The Companys segments include Pekin production, Marketing and distribution and Western production. The Pekin production segment includes the production and sale of alcohol and essential ingredients produced at its three production facilities located in Pekin, Illinois. The Marketing and distribution segment includes marketing and merchant trading of company-produced alcohols and essential ingredients on an aggregated basis, and sales of fuel-grade ethanol sourced from third parties. The Western production segment includes the production and sale of renewable fuels and essential ingredients, and liquid carbon dioxide (CO2) produced at its western production facilities, including liquid CO2 plant on an aggregated basis. It focuses on Health, Home & Beauty; Food & Beverage; Industry & Agriculture; Essential Ingredients; and Renewable Fuels markets.', 'Pekin, IL, United States', 393);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLBD', 'STOCK', 'Blue Bird Corporation', 'NGM', 'Industrials', 'Farm & Heavy Construction Machinery', 'Blue Bird Corporation is an independent designer and manufacturer of school buses. The Company is engaged in designing and manufacturing low- and zero-emission school buses with more than 20,000 propane, natural gas, and electric powered buses. The Company operates through two segments: Bus segment and Parts segment. The Bus segment includes the manufacture and assembly of buses to be sold to a variety of customers across the United States, Canada, and in certain limited international markets. The Parts segment consists primarily of the purchase of parts from third parties to be sold to dealers within the Companys network and certain large fleet customers. The Company designs, engineers, manufactures, and sells three types of buses: Type C school buses, Type D school buses, and specialty buses. Its network of dealers and authorized repair centers operate over 200 locations to support the fleet across the U.S. and Canada. It maintains a parts distribution center in Delaware, Ohio.', 'Macon, GA, United States', 1945);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMR', 'STOCK', 'Alpha Metallurgical Resources, Inc.', 'NYQ', 'Basic Materials', 'Coking Coal', 'Alpha Metallurgical Resources, Inc. is a mining company with operations across Virginia and West Virginia. The Company supplies metallurgical products to the steel industry. Its portfolio of mining operations consists of over 14 underground mines, six surface mines and eight coal preparation plants. It extracts, processes and markets metallurgical coal from deep and surface mines for sale to steel and coke producers, industrial customers, and electric utilities. It conducts mining operations only in the United States with mines in Central Appalachia. The Company operates in one segment: Met, which consists of six active mining complexes whose primary product is metallurgical coal that is extracted, processed, and marketed to domestic and international steel and coke producers. The Met segment operations consist of metallurgical coal mines, including Deep Mine 41, Road Fork 52, Black Eagle, and Lynn Branch.', 'Bristol, TN, United States', 3890);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCV', 'STOCK', 'Invesco BulletShares 2031 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, “effective maturities” in the year 2031 (collectively, “2031 Bonds”).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASLE', 'STOCK', 'AerSale Corporation', 'NCM', 'Industrials', 'Airports & Air Services', 'AerSale Corporation is a provider of aftermarket commercial aircraft, engines, and their parts to passenger and cargo airlines, leasing companies, original equipment manufacturers (OEM), government and defense contractors, and maintenance, repair and overhaul (MRO) service providers. It operates as a platform for serving the commercial aviation aftermarket sector. It serves airlines operating jets manufactured by Boeing, Airbus and McDonnell Douglas and is engaged in providing integrated aftermarket services and products designed to help aircraft owners and operators to realize savings in the operation, maintenance and monetization of their aircraft, engines, and components. Its Asset Management Solutions segment consists of activities to extract value from strategic asset acquisitions through leasing, trading, or disassembling for product sales. Its TechOps segment consists of MRO activities and product sales of internally developed engineered solutions and other serviceable products.', 'Doral, FL, United States', 636);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATRO', 'STOCK', 'Astronics Corporation', 'NMS', 'Industrials', 'Aerospace & Defense', 'Astronics Corporation is a provider of advanced technologies to the global aerospace, defense, and electronics industries. The Companys products and services include advanced, high-performance electrical power generation, distribution and seat motion systems, lighting and safety systems, avionics products, systems and certification, aircraft structures and automated test systems. The Companys segments include Aerospace and Test Systems. The Aerospace segment designs and manufactures products for the global aerospace and defense industry. The Test Systems segment designs, develops, manufactures and maintains automated test systems that support the aerospace and defense, communications and mass transit industries as well as training and simulation devices for both commercial and military applications. It also offers FAA Organization Designation Authorization (ODA) services. Its products and solutions include emergency systems, lighting systems, and seat actuation systems.', 'East Aurora, NY, United States', 2500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASNS', 'STOCK', 'Actelis Networks, Inc.', 'NCM', 'Technology', 'Communication Equipment', 'Actelis Networks, Inc. provides cyber-hardened, rapid-deployment hybrid fiber networking solutions for wide-area Internet of things (IoT) applications including federal, state and local government, intelligent traffic systems (ITS), military, utility, rail, telecom and campus applications. The Company''s portfolio capabilities include hybrid fiber, environmentally hardened aggregation switches, high density ethernet devices, advanced management software and artificial intelligence (AI)-based cyber-security offering. It offers Triple-Shield protection of data delivered with coding, scrambling and encryption of the network traffic. It also provides secure, encrypted access to its network management software. In addition, its solutions can also provide power over existing copper and coax lines to remotely power up network elements and IoT components connected to them (like cameras, small cell and others). Its products include Gigaline 800/900/5000/6000 Series, MetaShield, and others.', 'Fremont, CA, United States', 38);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVAH', 'STOCK', 'Aveanna Healthcare Holdings Inc.', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Aveanna Healthcare Holdings Inc. is a provider of diversified home care platforms. Its segments include Private Duty Services (PDS), Home Health & Hospice (HHH), and Medical Solutions (MS). PDS segment includes private duty nursing (PDN) services, as well as pediatric therapy services. HHH segment includes home health services, as well as hospice and specialty program services. Its home health services involve the provision of in-home services to its patients by its clinicians, which include nurses, therapists, social workers and home health aides. Its hospice services involve a supportive philosophy and concept of care for those nearing the end of life. Medical Solutions segment offers a line of enteral nutrition supplies and other products to adults and children, delivered on a periodic or as-needed basis. It also provides case management services to assist families and patients by coordinating the provision of services between insurers and other healthcare providers.', 'Atlanta, GA, United States', 33500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBT', 'STOCK', 'Cabot Corporation', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Cabot Corporation is a global specialty chemicals and performance materials company. The Company''s principal products are reinforcing and specialty carbons, specialty compounds, conductive additives, carbon nanotubes, fumed metal oxides, inkjet colorants and aerogel. It operates through two segments: Reinforcement Materials and Performance Chemicals. Its reinforcing carbon products are used in tires and industrial products. In addition to its reinforcing carbons, it manufactures engineered elastomer composites (E2C) solutions that are composites of reinforcing carbons and rubber made using its patented elastomer composites manufacturing process. Under Performance Chemicals segment, it designs, manufactures and sells materials that deliver performance in a range of customer applications across the automotive, construction, infrastructure, inkjet printing, electronics, and consumer products sectors and in applications related to the generation, transmission and storage of energy.', 'Boston, MA, United States', 4151);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MLKN', 'STOCK', 'MillerKnoll, Inc.', 'NMS', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'MillerKnoll, Inc. is engaged in the research, design, manufacture, selling and distribution of seating products, furniture systems, other freestanding furniture elements, textiles, leather, felt, home furnishings and related services. Its segments include Americas Contract, International Contract & Specialty, and Global Retail. Americas Contract segment includes the operations associated with the design, manufacture and sale of furniture products directly or indirectly through an independent dealership network for office, healthcare, and educational environments throughout North and South America. International Contract & Specialty segment includes the operations associated with the design, manufacture and sale of furniture products, directly or indirectly through an independent dealership network in Europe, the Middle East, Africa and Asia-Pacific. Global Retail segment includes operations associated with the sale of modern design furnishings and accessories to third party retailers.', 'Zeeland, MI, United States', 10382);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTCK', 'STOCK', 'Davis Commodities Limited', 'NCM', 'Consumer Defensive', 'Farm Products', 'Davis Commodities Limited is an agricultural commodity trading company. It is engaged in the trading of three main categories of agricultural commodities, namely sugar, rice, and oil and fat products. The Companys segments include the sale of sugar, sale of rice, sale of oil and fat products, and sale of others. It also provides customers with ancillary services, such as warehouse handling and storage and logistics services. It is engaged in using a global network of third-party commodity suppliers and logistics service providers to distribute sugar, rice, and oil and fat products to customers in approximately 20 countries. The Company markets the commodities it distributes under two main brands, namely Maxwill and Taffy. The Maxwill brand is used for the sugar products and oil and fat products that the Company distributes outside of Singapore. Its subsidiaries include Maxwill Pte. Ltd., Maxwill (Asia) Pte. Ltd., LP Grace Pte. Ltd., Maxwill Foodlink Pte. Ltd., among others.', 'Singapore, , Singapore', 21);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIO', 'STOCK', 'Bio-Rad Laboratories, Inc.', 'NYQ', 'Healthcare', 'Medical Devices', 'Bio-Rad Laboratories, Inc. is engaged in developing, manufacturing, and marketing a range of products for the life science research and clinical diagnostics markets. The Company offers a range of products and systems used to separate complex chemical and biological materials and to identify, analyze and purify their components. It operates through two segments: Life Science and Clinical Diagnostics. The Life Science segment develops, manufactures, and markets instruments, systems, reagents, and consumables used for biological research, biopharmaceutical production processes, food testing regimes, and science education. Its Clinical Diagnostics segment designs, manufactures, markets and supports test systems, informatics systems, test kits and specialized quality controls that serve clinical laboratories in the global diagnostics market. These products are sold to hospital laboratories, diagnostic reference laboratories, transfusion laboratories, and physician office laboratories.', 'Hercules, CA, United States', 7700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('QUIK', 'STOCK', 'QuickLogic Corporation', 'NCM', 'Technology', 'Semiconductors', 'QuickLogic Corporation is a semiconductor company that develops embedded FPGA (eFPGA) intellectual property (IP), discrete FPGAs, and FPGA system-on-chips (SoCs) for a variety of industrial, aerospace and defense, edge, and endpoint artificial intelligence (AI), consumer, and computing applications. Its products include eFPGA IP Licensing business and associated professional services, consisting of the development and integration of eFPGA technology into custom semiconductor solutions. Its silicon products consist of EOS, QuickAI, ArcticLink III, PolarPro3, PolarPro II, PolarPro, and others. Its new products category includes its artificial intelligence/machine learning (AI/ML) Software Platform from its subsidiary company, SensiML, which includes Software-as-a-Service (SaaS) subscriptions for development when deployed in production, and proof-of-concept services. Its mature products include FPGA families named PASIC3 and QuickRAM, as well as programming hardware and design software.', 'San Jose, CA, United States', 59);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTS', 'STOCK', 'CTS Corporation', 'NYQ', 'Technology', 'Electronic Components', 'CTS Corporation is a global manufacturer of sensors, connectivity components, and actuators. The Company designs, manufactures, and sells a broad line of sensors, connectivity components, and actuators primarily to original equipment manufacturers (OEMs), suppliers for the aerospace and defense, industrial, medical, and transportation markets, and the United States Government. The Companys devices are categorized by their ability to Sense, Connect or Move. Sense products provide vital inputs to electronic systems. Connect products allow systems to function in synchronization with other systems. Move products ensure the required movements are effectively and accurately executed. Its Sense products include Controls, Pedals, Piezo Sensing Products, Sensors, Switches and Transducers. Its Connect products include EMI/RFI Filters, Capacitors, Frequency Control Products, Resistors and RF filters. The Companys Move products include Piezo Microactuators and Rotary Actuators.', 'Lisle, IL, United States', 3549);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EG', 'STOCK', 'Everest Group, Ltd.', 'NYQ', 'Financial Services', 'Insurance - Reinsurance', 'Everest Group, Ltd. É um underwriter baseado em Bermudas. A Empresa fornece soluções de seguros e resseguros de propriedade, acidentes e especialidades. Atua através de dois segmentos operacionais: Resseguro e Seguros. A operação de resseguro escreve resseguro de propriedade e de responsabilidade civil e linhas de negócios especializadas, tanto em base de tratado como facultativo, através de corretores de resseguros, bem como diretamente com empresas cedentes. Os negócios são escritos nos escritórios dos Estados Unidos (EUA), Bermudas e Irlanda, bem como através de filiais no Canadá, Cingapura, Reino Unido (Reino Unido) e Suíça. A operação de seguro escreve seguro de propriedade e acidentes diretamente e através de corretores, incluindo para linhas excedentes, e agentes gerais dentro dos EUA, Bermudas, Canadá, Europa, Cingapura, e América do Sul através de seus escritórios nos EUA, Austrália, Canadá, Chile, Colômbia, México, Cingapura, Reino Unido, Irlanda e filiais localizadas no Rein', 'Hamilton, , Bermuda', 3037);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRWL', 'STOCK', 'GraniteShares 2x Long CRWD Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2x (200%) the daily percentage change of the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHE', 'STOCK', 'Benchmark Electronics, Inc.', 'NYQ', 'Technology', 'Electronic Components', 'Benchmark Electronics, Inc. provides comprehensive solutions across the entire product life cycle through its technology and engineering design services, leveraging its global supply chain and delivering manufacturing services in various industries. It provides design engineering and advanced manufacturing services that include both electronic manufacturing services (EMS) and precision technology (PT) services. Its advanced manufacturing services include printed circuit board assembly (PCBA) and test, component engineering services, systems assembly and test development, and failure analysis. In addition to traditional EMS, it offers complex PT services, including full electromechanical assembly and test services. It offers a full spectrum of new product design, automation, test development, prototype and related engineering services. It provides its customers with a comprehensive range of custom circuit and functional test equipment, process automation and replication solutions.', 'Tempe, AZ, United States', 11700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATGE', 'STOCK', 'Adtalem Global Education Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'Adtalem Global Education Inc. is a provider of healthcare education in the United States, preparing a diverse workforce with academic programs. Its healthcare programs include nursing, medicine, veterinary medicine, social and behavioral sciences and more. Its segments include Chamberlain, Walden, and Medical and Veterinary. Chamberlain segment offers degree and certificate programs in the nursing and health professions postsecondary education industry. Walden segment offers degree and certificate programs, including those in nursing, education, counseling, business, psychology, public health, social work and human services, public administration and public policy, and criminal justice. Medical and Veterinary segment offers degree and certificate programs in the medical and veterinary postsecondary education industry. This segment includes American University of the Caribbean School of Medicine, Ross University School of Medicine, and Ross University School of Veterinary Medicine.', 'Chicago, IL, United States', 4703);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFYA', 'STOCK', 'Afya Limited', 'NMS', 'Consumer Defensive', 'Education & Training Services', 'A Afya Ltd é uma empresa sediada no Brasil envolvida no setor de educação. A empresa está focada principalmente na operação de escolas médicas, oferecendo cursos de ciências da saúde, que compreendem medicina, odontologia, enfermagem, radiologia, psicologia, farmácia, educação física, fisioterapia, nutrição e biomedicina. Além disso, o escritório oferece programas de graduação e cursos em outras disciplinas e disciplinas, incluindo cursos de graduação e pós-graduação em administração de empresas, contabilidade, direito, engenharia civil, engenharia industrial e pedagogia. A abordagem metodológica da empresa combina conteúdo integrado, aprendizagem interativa e uma experiência adaptativa para os alunos. Através de seu conteúdo educacional e atividades tecnológicas, a empresa se concentra em uma aprendizagem personalizada que espelha a tutoria individual. Os campi de graduação e pós-graduação da Companhia estão espalhados pelo Brasil, bem como sua plataforma médica digital.', 'Nova Lima, MG, Brazil', NULL);\n
